import React, { useEffect } from "react";
import { useNavigate } from "react-router";
import PostForm from "./PostForm";
const Dashboard = () => {
  return (
    <>
      <section>
        <h1> Welcome </h1>
        <p>Dashboard</p>
      </section>
      <PostForm />
    </>
  );
};

export default Dashboard;
